import torch
from transformers import AutoProcessor, MusicgenForConditionalGeneration
import io
import scipy.io.wavfile
import modelbit
import base64  # Import base64 module

# Load the processor and model
processor = AutoProcessor.from_pretrained("facebook/musicgen-small")
model = MusicgenForConditionalGeneration.from_pretrained("facebook/musicgen-small")

print("Model and Processor Loaded")

# Save the model's state dictionary
torch.save(model.state_dict(), "musicgen_model.pth")

def generate_music(prompts, model):
    try:
        inputs = processor(
            text=prompts,
            padding=True,
            return_tensors="pt",
        )

        audio_values = model.generate(**inputs, max_new_tokens=256)

        buffer = io.BytesIO()
        sampling_rate = model.config.audio_encoder.sampling_rate
        scipy.io.wavfile.write(
            buffer,
            rate=sampling_rate,
            data=audio_values[0, 0].numpy()
        )
        buffer.seek(0)

        # Convert the binary data to base64 before returning
        audio_base64 = base64.b64encode(buffer.getvalue()).decode("utf-8")
        return audio_base64  # Return base64-encoded audio

    except Exception as e:
        print(f"Error details: {str(e)}")
        raise Exception(str(e))

def predict(prompts):
    # Load the model from the state dictionary
    model = MusicgenForConditionalGeneration.from_pretrained("facebook/musicgen-small")
    model.load_state_dict(torch.load("musicgen_model.pth"))
    model.eval()

    # Generate music
    audio_data_base64 = generate_music(prompts, model)
    return {"audio": audio_data_base64}  # Return as a dictionary with the base64-encoded audio

# Login to Modelbit
mb = modelbit.login()

# Deploy the model
deployment = mb.deploy(predict, name="music_generator", extra_files=["musicgen_model.pth"])
# Print the deployment URL
print(f"Deployment URL: {deployment.url}")

# Test the deployed model
response = modelbit.get_inference(
    workspace=deployment.workspace,
    region=deployment.region,
    deployment="music_generator",
    data=["Create a cheerful piano melody"]
)

# The response will contain base64-encoded audio
audio_data_base64 = response["result"]["audio"]

# Decode the base64-encoded audio and save it to a file
audio_data = base64.b64decode(audio_data_base64)

with open("generated_music.wav", "wb") as f:
    f.write(audio_data)

